 precision;	term1 double precision;BEGIN	n1 = a.n;	a.n = a.n + 1;	delta = x - a.m1;	delta_n = delta / a.n;	delta_n2 = delta_n * delta_n;	term1 = delta * delta_n * n1;	a.m1 = a.m1 + delta_n;	a.m4 = a.m4 + term1 * delta_n2 * (a.n*a.n - 3*a.n + 3) + 6 * delta_n2 * a.m2 - 4 * delta_n * a.m3;	a.m3 = a.m3 + term1 * delta_n * (a.n - 2) - 3 * delta_n * a.m2;	a.m2 = a.m2 + term1;	a.min = least(a.min, x);	a.max = greatest(a.max, x);	RETURN a;END;$function$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:functions:_stats_agg_finalizer.tests.sql------------------------------------------------------------------------------------- Checks for tools._stats_agg_finalizer (_stats_agg_accum_type) function------------------------------------------------------------------------------------- Existence check:select * from test_case_setup('Function', 'tools', '_stats_agg_finalizer (_stats_agg_accum_type)', '()', 'tools._stats_agg_finalizer _stats_agg_accum_type existence check', 'select count(*) from pg_proc where pronamespace::regnamespace::text = ''tools''   and proname = ''_stats_agg_finalizer''   and pg_get_function_identity_arguments(oid) = ''_stats_agg_accum_type'';', '1', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');-- Definition check:select * from test_case_setup('Function', 'tools', '_stats_agg_finalizer (_stats_agg_accum_type)', '()', 'tools._stats_agg_finalizer _stats_agg_accum_type definition check', 'select pg_get_functiondef(oid) from pg_proc where pronamespace::regnamespace::text = ''tools''   and proname = ''_stats_agg_finalizer''   and pg_get_function_identity_arguments(oid) = ''_stats_agg_accum_type'';', 'CREATE OR REPLACE FUNCTION tools._stats_agg_finalizer(_stats_agg_accum_type) RETURNS _stats_agg_result_type LANGUAGE plpgsqlAS $function$BEGIN	RETURN row(		$1.n,		$1.min,		$1.max,		$1.m1,		$1.m2 / nullif(($1.n - 1.0), 0),		case when $1.m2 = 0 then null else sqrt($1.n) * $1.m3 / nullif(($1.m2 ^ 1.5), 0) end,		case when $1.m2 = 0 then null else $1.n * $1.m4 / nullif(($1.m2 * $1.m2) - 3.0, 0) end	);END;$function$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:functions:activity_for_facility.tests.sql------------------------------------------------------------------------------------- Checks for ascendco.activity_for_facility (in_facility_id uuid) function------------------------------------------------------------------------------------- Existence check:select * from test_case_setup('Function', 'ascendco', 'activity_for_facility (in_facility_id uuid)', '()', 'ascendco.activity_for_facility in_facility_id uuid existence check', 'select count(*) from pg_proc where pronamespace::regnamespace::text = ''ascendco''   and proname = ''activity_for_facility''   and pg_get_function_identity_arguments(oid) = ''in_facility_id uuid'';', '1', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');-- Definition check:select * from test_case_setup('Function', 'ascendco', 'activity_for_facility (in_facility_id uuid)', '()', 'ascendco.activity_for_facility in_facility_id uuid definition check', 'select pg_get_functiondef(oid) from pg_proc where pronamespace::regnamespace::text = ''ascendco''   and proname = ''activity_for_facility''   and pg_get_function_identity_arguments(oid) = ''in_facility_id uuid'';', 'CREATE OR REPLACE FUNCTION ascendco.activity_for_facility(in_facility_id uuid) RETURNS TABLE(activity_id uuid, hsys_name citext, facility_id uuid, facility_name citext, activity_name citext, server_name citext, start_dts timestamp without time zone, done_dts timestamp without time zone, duration_seconds integer, updated_dts timestamp without time zone, marked_for_deletion boolean, other_desc citext, user_name citext, created_dts timestamp without time zone, created_by citext, updated_by citext) LANGUAGE sql STABLEAS $function$SELECT activity.id                                             AS activity_id,       coalesce(hsys.name_, ''Unknown'')                         AS hsys_name,       facility.id,       coalesce(facility.name_, ''Unknown'')                     AS facility_name,       coalesce(facility_activities.name_, ''Unknown'')          AS activity_name,       coalesce(data_file_info.server_name_, ''Unknown'')        AS server_name,       activity.start_dts,       activity.done_dts,       activity.duration_seconds,       activity.updated_dts,       activity.marked_for_deletion,       activity.other_desc,       coalesce(web_user.name_full, ''Unknown'')                 AS user_name,       activity.created_dts,       activity.created_by,       activity.updated_by--   Note: activity doesn''t have hsys_id, you neeed to load facility, and get the hsys_id from there.     FROM activityLEFT JOIN facility_activities  ON facility_activities.id   = activity.facility_activities_idLEFT JOIN web_user             ON web_user.id              =  activity.web_user_idLEFT JOIN data_file_info       ON data_file_info.id        =  activity.last_updated_by_data_file_idLEFT JOIN facility             ON facility.id              =  activity.facility_idLEFT JOIN hsys                 ON hsys.id                  =  facility.hsys_idWHERE activity.facility_id = in_facility_id;$function$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:functions:activity_to_v1.tests.sql------------------------------------------------------------------------------------- Checks for types_plus.activity_to_v1 (activity_in activity) function------------------------------------------------------------------------------------- Existence check:select * from test_case_setup('Function', 'types_plus', 'activity_to_v1 (activity_in activity)', '()', 'types_plus.activity_to_v1 activity_in activity existence check', 'select count(*) from pg_proc where pronamespace::regnamespace::text = ''types_plus''   and proname = ''activity_to_v1''   and pg_get_function_identity_arguments(oid) = ''activity_in activity'';', '1', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');-- Definition check:select * from test_case_setup('Function', 'types_plus', 'activity_to_v1 (activity_in activity)', '()', 'types_plus.activity_to_v1 activity_in activity definition check', 'select pg_get_functiondef(oid) from pg_proc where pronamespace::regnamespace::text = ''types_plus''   and proname = ''activity_to_v1''   and pg_get_function_identity_arguments(oid) = ''activity_in activity'';', 'CREATE OR REPLACE FUNCTION types_plus.activity_to_v1(activity_in activity) RETURNS activity_v1 LANGUAGE sqlAS $function$                   SELECT			activity_in.id,			activity_in.facility_id,			activity_in.facility_activities_id,			activity_in.web_user_id,			activity_in.other_desc,			activity_in.start_dts,			activity_in.done_dts,			activity_in.last_updated_by_data_file_id,			activity_in.created_by,			activity_in.creat