a', 'column_tetris (table_in regclass)', '()', 'dba.column_tetris table_in regclass existence check', 'select count(*) from pg_proc where pronamespace::regnamespace::text = ''dba''   and proname = ''column_tetris''   and pg_get_function_identity_arguments(oid) = ''table_in regclass'';', '1', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');-- Definition check:select * from test_case_setup('Function', 'dba', 'column_tetris (table_in regclass)', '()', 'dba.column_tetris table_in regclass definition check', 'select pg_get_functiondef(oid) from pg_proc where pronamespace::regnamespace::text = ''dba''   and proname = ''column_tetris''   and pg_get_function_identity_arguments(oid) = ''table_in regclass'';', 'CREATE OR REPLACE FUNCTION dba.column_tetris(table_in regclass) RETURNS TABLE(column_name text, type_name text, type_align text, alignment_description text, type_length smallint, suggestioned_position bigint, current_position smallint) LANGUAGE sqlAS $function$   SELECT a.attname::text  AS column_name,          t.typname::text  AS type_name,          t.typalign::text AS type_align,          CASE             WHEN typalign = ''c'' THEN ''char alignment, no alignment needed''             WHEN typalign = ''s'' THEN ''short alignment, 2 bytes on most machines''             WHEN typalign = ''i'' THEN ''int alignment, 4 bytes on most machines''             WHEN typalign = ''d'' THEN ''double alignment, 8 bytes on many machines, but by no means all''             ELSE ''Unexpected typalign '' || typalign			END AS alignment_description,          t.typlen   AS type_length,          ROW_NUMBER () OVER (ORDER BY t.typlen DESC,a.attname) as suggested_position,          a.attnum   AS currrent_position     FROM pg_class c     JOIN pg_attribute a ON (a.attrelid = c.oid)     JOIN pg_type t ON (t.oid = a.atttypid)    WHERE c.relname = table_in::name AND          a.attnum >= 0 ORDER BY t.typlen DESC,a.attname;$function$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:functions:connection_snapshot_kvp.tests.sql------------------------------------------------------------------------------------- Checks for tools.connection_snapshot_kvp () function------------------------------------------------------------------------------------- Existence check:select * from test_case_setup('Function', 'tools', 'connection_snapshot_kvp ()', '()', 'tools.connection_snapshot_kvp  existence check', 'select count(*) from pg_proc where pronamespace::regnamespace::text = ''tools''   and proname = ''connection_snapshot_kvp''   and pg_get_function_identity_arguments(oid) = '''';', '1', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');-- Definition check:select * from test_case_setup('Function', 'tools', 'connection_snapshot_kvp ()', '()', 'tools.connection_snapshot_kvp  definition check', 'select pg_get_functiondef(oid) from pg_proc where pronamespace::regnamespace::text = ''tools''   and proname = ''connection_snapshot_kvp''   and pg_get_function_identity_arguments(oid) = '''';', 'CREATE OR REPLACE FUNCTION tools.connection_snapshot_kvp() RETURNS TABLE(setting_name text, setting_value text) LANGUAGE plpgsqlAS $function$DECLARE	search_path text;	BEGIN	 	 SELECT setting FROM pg_settings WHERE name=''search_path'' INTO search_path;	 SELECT ''user_name'',current_user INTO setting_name,setting_value;				RETURN NEXT;	 SELECT ''session_user_name'',session_user INTO setting_name,setting_value;		RETURN NEXT;	 SELECT ''role_nane'',current_role INTO setting_name,setting_value;				RETURN NEXT;	 SELECT ''database_name'',current_database() INTO setting_name,setting_value;		RETURN NEXT;	 SELECT ''server_version'',version() INTO setting_name,setting_value;				RETURN NEXT;	 SELECT ''search_path'',search_path INTO setting_name,setting_value;				RETURN NEXT;	 SELECT ''inet_client_addr'',inet_client_addr() INTO setting_name,setting_value;	RETURN NEXT;	 SELECT ''inet_client_port'',inet_client_port() INTO setting_name,setting_value;	RETURN NEXT;	 SELECT ''inet_server_addr'',inet_server_addr() INTO setting_name,setting_value;	RETURN NEXT;	 SELECT ''inet_server_port'',inet_server_port() INTO setting_name,setting_value;	RETURN NEXT;	 SELECT ''query'',current_query() INTO setting_name,setting_value;				RETURN NEXT;END$function$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:functions:connection_snapshot.tests.sql------------------------------------------------------------------------------------- Checks for tools.connection_snapshot () function------------------------------------------------------------------------------------- Existence check:select * from test_case_setup('Function', 'tools', 'connection_snapshot ()', '()', 'tools.connection_snapshot  existence check', 'select count(*) from pg_proc where pronamespace::regnamespace::text = ''tools''   and proname = ''connection_snapshot''   and pg_get_function_identity_arguments(oid) = '''';', '1', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');-- Definition check:select * from test_case_setup('Function', 'tools', 'connection_snapshot ()', '()', 'tools.connection_snapshot  definition check', 'select pg_get_functiondef(oid) from pg_proc where pronamespace::regnamespace::text = ''tools''   and proname = ''connection_snapshot''   and pg_get_function_identity_arguments(oid) = '''';', 'CREATE OR REPLACE FUNCTION tools.connection_snapshot() RETURNS TABLE(user_name text, session_user_name text, role_nane text, database_name text, server_version text, search_path text, inet_client_addr inet, inet_client_port integer, inet_server_addr inet, inet_server_port integer, query text) LANGUAGE plpgsqlAS $function$ BEGIN	 user_name := current_user;	 session_user_name := session_user;	 role_nane := current_role;	 database_name := current_database();	 server_version := version();	 	 SELECT setting FROM pg_settings WHERE name=''search_path'' INTO search_path;	 inet_client_addr := inet_client_addr();	 inet_client_port := inet_client_port();	 inet_server_addr := inet_server_addr();	 inet_server_port := inet_server_port();		 query := current_query();		 RETURN NEXT;END$function$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:functions:convert_ib_timezone_name.tests.sql------------------------------------------------------------------------------------- Checks for api.convert_ib_timezone_name (tz_name_in citext) function------------------------------------------------------------------------------------- Existence check:select * from test_case_setup('Function', 'api', 'convert_ib_timezone_name (tz_name_in citext)', '()', 'api.convert_ib_timezone_name tz_name_in citext existence check', 'select count(*) from pg_proc where pronamespace::regnamespace::text = ''api''   and proname = ''convert_ib_timezone_name''   and pg_get_function_identity_arguments(oid) = ''tz_name_in citext'';', '1', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');-- Definition check:select * from test_case_setup('Function', 'api', 'convert_ib_timezone_name (tz_name_in citext)', '()', 'api.convert_ib_timezone_name tz_name_in citext definition check', 'select pg_get_functiondef(oid) from pg_proc where pronamespace::regnamespace::text = ''api''   and proname = ''convert_ib_timezone_name''   and pg_get_function_identity_arguments(oid) = ''tz_name_in citext'';', 'CREATE OR REPLACE FUNCTION api.convert_ib_timezone_name(tz_name_in citext) RETURNS citext LANGUAGE sql IMMUTABLEAS $function$-- IB uses custom names, convert these to standard tz names.SELECTCASE WHEN tz_name_in = ''Arizona''  THEN ''US/Arizona''::citext     WHEN tz_name_in = ''Central''  THEN ''US/Central''::citext     WHEN tz_name_in = ''Eastern''  THEN ''US/Eastern''::citext     WHEN tz_name_in = ''Mountain'' THEN ''US/Mountain''::citext     WHEN tz_name_in = ''Pacific''  THEN ''US/Pacific''::citext     WHEN tz_name_in = ''Western''  THEN ''US/Pacific''::citext  -- IB uses ''Western'' instead of ''Pacific''     ELSE ''UTC''::citextEND$function$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:functions:count_rows_unqualified.tests.sql------------------------------------------------------------------------------------- Checks for tools.count_rows_unqualified (tablename text) function------------------------------------------------------------------------------------- Existence check:select * from test_case_setup('Function', 'tools', 'count_rows_unqualified (tablenam