vot (central_query text, headers_query text)', '()', 'tools.dynamic_pivot central_query text, headers_query text existence check', 'select count(*) from pg_proc where pronamespace::regnamespace::text = ''tools''   and proname = ''dynamic_pivot''   and pg_get_function_identity_arguments(oid) = ''central_query text, headers_query text'';', '1', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');-- Definition check:select * from test_case_setup('Function', 'tools', 'dynamic_pivot (central_query text, headers_query text)', '()', 'tools.dynamic_pivot central_query text, headers_query text definition check', 'select pg_get_functiondef(oid) from pg_proc where pronamespace::regnamespace::text = ''tools''   and proname = ''dynamic_pivot''   and pg_get_function_identity_arguments(oid) = ''central_query text, headers_query text'';', 'CREATE OR REPLACE FUNCTION tools.dynamic_pivot(central_query text, headers_query text) RETURNS refcursor LANGUAGE plpgsqlAS $function$DECLARE  left_column text;  header_column text;  value_column text;  h_value text;  headers_clause text;  query text;  j json;  r record;  curs refcursor;  i int:=1;BEGIN  -- find the column names of the source query  EXECUTE ''select row_to_json(_r.*) from ('' ||  central_query || '') AS _r'' into j;  FOR r in SELECT * FROM json_each_text(j)  LOOP    IF (i=1) THEN left_column := r.key;      ELSEIF (i=2) THEN header_column := r.key;      ELSEIF (i=3) THEN value_column := r.key;    END IF;    i := i+1;  END LOOP;  --  build the dynamic transposition query (based on the canonical model)  FOR h_value in EXECUTE headers_query  LOOP    headers_clause := concat(headers_clause,     format(chr(10)||'',min(case when %I=%L then %I::text end) as %I'',           header_column,	   h_value,	   value_column,	   h_value ));  END LOOP;  query := format(''SELECT %I %s FROM (select *,row_number() over() as rn from (%s) AS _c) as _d GROUP BY %I order by min(rn)'',           left_column,	   headers_clause,	   central_query,	   left_column);  -- open the cursor so the caller can FETCH right away  OPEN curs FOR execute query;  RETURN curs;END $function$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:functions:explain_this.tests.sql------------------------------------------------------------------------------------- Checks for dba.explain_this (l_query text, OUT explain json) function------------------------------------------------------------------------------------- Existence check:select * from test_case_setup('Function', 'dba', 'explain_this (l_query text, OUT explain json)', '()', 'dba.explain_this l_query text, OUT explain json existence check', 'select count(*) from pg_proc where pronamespace::regnamespace::text = ''dba''   and proname = ''explain_this''   and pg_get_function_identity_arguments(oid) = ''l_query text, OUT explain json'';', '1', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');-- Definition check:select * from test_case_setup('Function', 'dba', 'explain_this (l_query text, OUT explain json)', '()', 'dba.explain_this l_query text, OUT explain json definition check', 'select pg_get_functiondef(oid) from pg_proc where pronamespace::regnamespace::text = ''dba''   and proname = ''explain_this''   and pg_get_function_identity_arguments(oid) = ''l_query text, OUT explain json'';', 'CREATE OR REPLACE FUNCTION dba.explain_this(l_query text, OUT explain json) RETURNS SETOF json LANGUAGE