lpgsqlAS $function$BEGINRETURN QUERY EXECUTE ''with table_estimate as (select correlation  from pg_stats   where tablename = '''''' || table_name || '''''' and         attname   = '''''' || field_name || ''''''),          distinct_values as  (select distinct '' || quote_ident(field_name) || ''::citext as distinct_value,         count(*) as frequency     from '' || quote_ident(table_name) || '' group by '' || quote_ident(field_name) || ''),  row_figures as  (select count(*) as rows_count     from '' || quote_ident(table_name) || '') select  distinct_values.distinct_value,        table_estimate.correlation as page_correlation,        (select count(*) as field_cardinality from distinct_values),		 row_figures.rows_count,		 distinct_values.frequency as value_frequency,          round((distinct_values.frequency::decimal / row_figures.rows_count::decimal),3) as value_selectivity,        repeat('' || quote_literal('''') || '', ((distinct_values.frequency::decimal / row_figures.rows_count::decimal)*100)::int) as proportion_chart           from distinct_values,        table_estimate,        row_figures        ''    	using  table_name, field_name;END;$function$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:functions:find_outliers.tests.sql------------------------------------------------------------------------------------- Checks for ascendco.find_outliers (table_name text, field_name text, frequency_threshold integer, value_threshold integer) function------------------------------------------------------------------------------------- Existence check:select * from test_case_setup('Function', 'ascendco', 'find_outliers (table_name text, field_name text, frequency_threshold integer, value_threshold integer)', '()', 'ascendco.find_outliers table_name text, field_name text, frequency_threshold integer, value_threshold integer existence check', 'select count(*) from pg_proc where pronamespace::regnamespace::text = ''ascendco''   and proname = ''find_outliers''   and pg_get_function_identity_arguments(oid) = ''table_name text, field_name text, frequency_threshold integer, value_threshold integer'';', '1', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');-- Definition check:select * from test_case_setup('Function', 'ascendco', 'find_outliers (table_name text, field_name text, frequency_threshold integer, value_threshold integer)', '()', 'ascendco.find_outliers table_name text, field_name text, frequency_threshold integer, value_threshold integer definition check', 'select pg_get_functiondef(oid) from pg_proc where pronamespace::regnamespace::text = ''ascendco''   and proname = ''find_outliers''   and pg_get_function_identity_arguments(oid) = ''table_name text, field_name text, frequency_threshold integer, value_threshold integer'';', 'CREATE OR REPLACE FUNCTION ascendco.find_outliers(table_name text, field_name text, frequency_threshold integer, value_threshold integer) RETURNS TABLE(value_ integer, frequency_percentile integer, value_percentile integer) LANGUAGE plpgsqlAS $function$BEGIN	RETURN QUERY EXECUTE ''withfrequency_counts as (   select '' ||  field_name || ''::INT as value_,          count(*) as frequency              from '' || table_name || ''			  where '' ||  field_name || '' > 0	      group by 1	      order by 2),frequency_percentiles as (   select *,         ntile(100) over (order by frequency asc) as frequency_percentile,         ntile(100) over (order by value_ asc) as value_percentile	  from frequency_counts)select value_,       frequency_percentile,       value_percentile  from frequency_percentiles   where frequency_percentile < '' || frequency_threshold || ''  and         value_ >         (select value_          from frequency_counts          where value_percentile > '' || value_threshold || ''          limit 1)order by 1,2,3'';END;$function$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:functions:find_rare_and_large.tests.sql------------------------------------------------------------------------------------- Checks for ascendco.find_rare_and_large (table_name text, field_name text, frequency_threshold integer, value_threshold integer, target_server text) function------------------------------------------------------------------------------------- Existence check:select * from test_case_setup('Function', 'ascendco', 'find_rare_and_large (table_name text, field_name text, frequency_threshold integer, value_threshold integer, target_server text)', '()', 'ascendco.find_rare_and_large table_name text, field_name text, frequency_threshold integer, value_threshold integer, target_server text existence check', 'select count(*) from pg_proc where pronamespace::regnamespace::text = ''ascendco''   and proname = ''find_rare_and_large''   and pg_get_function_identity_arguments(oid) = ''table_name text, field_name text, frequency_threshold integer, value_threshold integer, target_server text'';', '1', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');-- Definition check:select * from test_case_setup('Function', 'ascendco', 'find_rare_and_large (table_name text, field_name text, frequency_threshold integer, value_threshold integer, target_server text)', '()', 'ascendco.find_rare_and_large table_name text, field_name text, frequency_threshold integer, value_threshold integer, target_server text definition check', 'select pg_get_functiondef(oid) from pg_proc where pronamespace::regnamespace::text = ''ascendco''   and proname = ''find_rare_and_large''   and pg_get_function_identity_arguments(oid) = ''table_name text, field_name text, frequency_threshold integer, value_threshold integer, target_server text'';', 'CREATE OR REPLACE FUNCTION ascendco.find_rare_and_large(table_name text, field_name text, frequency_threshold integer, value_threshold integer, target_server text DEFAULT ''All''::text) RETURNS TABLE(value_ integer, frequency integer, frequency_percentile integer, value_percentile integer) LANGUAGE plpgsqlAS $function$BEGINIF (target_server = ''All'') THEN    RETURN QUERY EXECUTE ''	with frequency_counts as (	  select '' || quote_ident(field_name) || ''::INT as value_,	   	      count(*) as frequency	    from '' || quote_ident(table_name) || ''	   where '' || quote_ident(field_name) || '' > 0	group by 1	order by 2),	frequency_percentiles as (	  select *,	         ntile(100) over (order by frequency asc) as frequency_percentile,	         ntile(100) over (order by value_ asc) as value_percentile	   from frequency_counts)	select value_,	       frequency::INT,	       frequency_percentile,	       value_percentile	  from frequency_percentiles	   where frequency_percentile < $3 and	         value_ >	         (select value_	          from frequency_counts	          where value_percentile > $4	          limit 1)	order by 1,2,3''	using  table_name, field_name, frequency_threshold, value_threshold;ELSE    RETURN QUERY EXECUTE ''	with frequency_counts as (	  select '' || quote_ident(field_name) || ''::INT as value_,	   	      count(*) as frequency	    from '' || quote_ident(table_name) || '' 	inner join data_file_info on (data_file_info.id = '' || quote_ident(table_name) || ''.data_file_id)	   where '' || quote_ident(field_name) || '' > 0 and	         data_file_info.server_name_ = $5	group by 1	order by 2),	frequency_percentiles as (	  select *,	         ntile(100) over (order by frequency asc) as frequency_percentile,	         ntile(100) over (order by value_ asc) as value_percentile	   from frequency_counts)	select value_,	       frequency::INT,	       frequency_percentile,	       value_percentile	  from frequency_percentiles	   where frequency_percentile < $3 and	         value_ >	         (select value_	          from frequency_counts	          where value_percentile >$4	          limit 1)	order by 1,2,3''	using  table_name, field_name, frequency_threshold, value_threshold, target_server;END IF;END;$function$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:functions:focus_to_v2.tests.sql------------------------------------------------------------------------------------- Checks for types_plus.focus_to_v2 (focus_in focus) function------------------------------------------------------------------------------------- Existence check:select * from test_case_setup('Function', 'types_plus', 'focus_to_v2 (focus_in focus)', '()', 'types_plus.focus_to_v2 focus_in focus existence check', 'select count(*) from pg_proc where pronamespace::regnamespace::text = ''types_plus''   and proname = ''focus_to_v2''   and pg_get_function_identity_arguments(oid) = ''focus_in focus'';', '1', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');-- Definition check:select * from test_case_setup('Function', 'types_p