y":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');-- Definition check:select * from test_case_setup('Function', 'tools', 'fuzzy_compare_cross (base_jsonb_in jsonb, comparison_jsonb_in jsonb, handicap_factor_in real, monge_elkan_similarity_method_in citext)', '()', 'tools.fuzzy_compare_cross base_jsonb_in jsonb, comparison_jsonb_in jsonb, handicap_factor_in real, monge_elkan_similarity_method_in citext definition check', 'select pg_get_functiondef(oid) from pg_proc where pronamespace::regnamespace::text = ''tools''   and proname = ''fuzzy_compare_cross''   and pg_get_function_identity_arguments(oid) = ''base_jsonb_in jsonb, comparison_jsonb_in jsonb, handicap_factor_in real, monge_elkan_similarity_method_in citext'';', 'CREATE OR REPLACE FUNCTION tools.fuzzy_compare_cross(base_jsonb_in jsonb, comparison_jsonb_in jsonb, handicap_factor_in real DEFAULT 0.3, monge_elkan_similarity_method_in citext DEFAULT ''jarowinkler''::citext) RETURNS TABLE(base_text citext, comparison_text citext, base_id citext, comparison_id citext, highest_score decimal_score, best_method citext, avg_score decimal_score, avg_quadratic_score decimal_score, lowest_score decimal_score, equality_check integer, jaro_score decimal_score, jaro_winkler_score decimal_score, levenshtein_score decimal_score, monge_elkan_score decimal_score, monge_elkan_quadratic_score decimal_score, monge_elkan_handicap_score decimal_score, monge_elkan_quadratic_handicap_score decimal_score, qgram_score decimal_score, trigram_score decimal_score) LANGUAGE plpgsqlAS $function$BEGIN-------------------------------------------------------------- Safety checks for parameters stitched into the SQL.------------------------------------------------------------    monge_elkan_similarity_method_in  := lower(monge_elkan_similarity_method_in);	IF monge_elkan_similarity_method_in NOT IN (''jaro'',''jarowinkler'',''qgram'') THEN		RAISE EXCEPTION USING			message = ''Invalid distance measure name '' || monge_elkan_similarity_method_in,			hint = ''Valid methods are jaro, jarowinkler, and qgram'',			errcode = ''KC300''; -- Custom code for ''Bad lookup ID''.    END IF;-------------------------------------------------------------- Range/sanity checks on thresholds------------------------------------------------------------	IF handicap_factor_in < 0 OR handicap_factor_in > 1 THEN		RAISE EXCEPTION USING			message = ''handicap_factor value is out of range.'',			hint = ''Value must be in the range 0-1.'',			errcode = ''KC202''; -- Custom code for ''Numeric parameter value is too low''.    END IF;RETURN QUERYWITHbase_expanded AS ( select *   from jsonb_to_recordset(     base_jsonb_in)  AS base_unpacked (                 text citext,                 id citext) ),comparison_expanded AS ( select *   from jsonb_to_recordset(     comparison_jsonb_in)  AS comparison_unpacked (                 text citext,                 id citext) ),combined_lists AS (select base_expanded.text         AS base_text_x,       base_expanded.id           AS base_id_x,       comparison_expanded.text   AS comparison_text_x,       comparison_expanded.id     AS comparison_id_x  from base_expanded,       comparison_expanded),---------------------------------------------------------- Pull in the basic scores, and add some handicaps--------------------------------------------------------basic_scores AS (select base_text_x,       comparison_text_x,       base_id_x,       comparison_id_x,       (base_text_x = comparison_text_x)::int4                                              AS equality_check_x,       monge_elkan(base_text_x, comparison_text_x, monge_elkan_similarity_method_in)        AS monge_elkan_score_x,       sqrt(monge_elkan(base_text_x, comparison_text_x, monge_elkan_similarity_method_in))  AS monge_elkan_quadratic_score_x,       jaccard(base_text_x, comparison_text_x)             