cient,         jaccard($1,$2) * $5          AS jaccard_handicap,         qgram($1,$2)                 AS qgram_score,         similarity($1,$2)            AS trigram_score,         word_similarity($1,$2)       AS word_score,         lev($1,$2)                   AS levenshtein_score,         jaro($1,$2)                  AS jaro_score,         jarowinkler($1,$2)           AS jaro_winkler_score),---------------------------------------------------------- Pull in the basic scores, and add some handicaps--------------------------------------------------------extended_scores AS (SELECT  base_text,        comparison_text,        base_id,        comparison_id,        equality_check,        jaro_score::decimal_score,        jaro_winkler_score::decimal_score,        levenshtein_score::decimal_score,        monge_elkan_score::decimal_score,        monge_elkan_quadratic_score::decimal_score,        (monge_elkan_score - jaccard_handicap)::decimal_score AS monge_elkan_handicap_score,        (monge_elkan_quadratic_score - jaccard_handicap)::decimal_score AS monge_elkan_quadratic_handicap_score,        jaccard_coefficient,        jaccard_handicap,        qgram_score::decimal_score,        trigram_score::decimal_score  FROM basic_scores),  score_stats AS (  SELECT GREATEST (           equality_check,           jaro_score,           jaro_winkler_score,           levenshtein_score,           monge_elkan_score,           monge_elkan_handicap_score,           monge_elkan_quadratic_score,           monge_elkan_quadratic_handicap_score,           qgram_score,           trigram_score)::decimal_score AS highest_score,-- Leave out equality_check out of LEAST and AVG scores. It''''s either 0 or 1, almost always 0.        LEAST (           jaro_score,           jaro_winkler_score,           levenshtein_score,           monge_elkan_score,           monge_elkan_handicap_score,           monge_elkan_quadratic_score,           monge_elkan_quadratic_handicap_score,           qgram_score,           trigram_score)::decimal_score AS lowest_score,         ((jaro_score +           jaro_winkler_score +           levenshtein_score +           monge_elkan_score +           monge_elkan_handicap_score +           monge_elkan_quadratic_score +           monge_elkan_quadratic_handicap_score +           qgram_score +           trigram_score) / 10)::decimal_score AS avg_score,          sqrt((jaro_score +           jaro_winkler_score +           levenshtein_score +           monge_elkan_score +           monge_elkan_handicap_score +           monge_elkan_quadratic_score +           monge_elkan_quadratic_handicap_score +           qgram_score +           trigram_score ) / 10)::decimal_score AS avg_quadratic_score     FROM extended_scores        )---------------------------------------------------------- Final result: Get everything, along with the top score--------------------------------------------------------SELECT extended_scores.base_text,       extended_scores.comparison_text,       extended_scores.base_id,       extended_scores.comparison_id,       score_stats.highest_score,        -- Ugh. Researching better methods for doing this part...and some of the others...bit too long.        -- In case of a tie, this code picks the first match.       CASE          WHEN score_stats.highest_score = 0 THEN ''''none''''          WHEN score_stats.highest_score = equality_check THEN ''''equality_check''''          WHEN score_stats.highest_score = extended_scores.monge_elkan_score THEN ''''monge_elkan''''          WHEN score_stats.highest_score = extended_scores.monge_elkan_handicap_score THEN ''''monge_elkan_handicap''''          WHEN score_stats.highest_score = extended_scores.monge_elkan_quadratic_score THEN ''''monge_elkan_quadratic''''          WHEN score_stats.highest_score = extended_scores.monge_elkan_quadratic_handicap_score THEN ''''monge_elkan_quadratic_handicap''''          WHEN score_stats.highest_score = extended_scores.qgram_score THEN ''''qgram''''          WHEN score_stats.highest_score = extended_scores.trigram_score THEN ''''trigram''''          WHEN score_stats.highest_score = extended_scores.levenshtein_score THEN ''''levenshtein''''          WHEN score_stats.highest_score = extended_scores.jaro_score THEN ''''jaro''''          WHEN score_stats.highest_score = extended_scores.jaro_winkler_score THEN ''''jaro_winkler''''          WHEN score_stats.highest_score = score_stats.avg_score THEN ''''avg''''          WHEN score_stats.highest_score = score_stats.avg_quadratic_score THEN ''''avg_quadratic''''        ELSE ''''Undefined''''::citext END AS best_method,       score_stats.avg_score,       score_stats.avg_quadratic_score,       score_stats.lowest_score,       extended_scores.equality_check,       extended_scores.jaro_score,       extended_scores.jaro_winkler_score,       extended_scores.levenshtein_score,       extended_scores.monge_elkan_score,       extended_scores.monge_elkan_quadratic_score,       extended_scores.monge_elkan_handicap_score,       extended_scores.monge_elkan_quadratic_handicap_score,       extended_scores.qgram_score,       extended_scores.trigram_score  FROM extended_scores,       score_stats;'';BEGIN-------------------------------------------------------------- Safety checks for parameters stitched into the SQL.------------------------------------------------------------	IF base_text_in = '''' THEN		RAISE EXCEPTION USING			message = ''A base string must be supplied.'',			errcode = ''KC101''; -- Custom code for ''Empty string parameter''.    END IF;    monge_elkan_similarity_method_in  := lower(monge_elkan_similarity_method_in);	IF monge_elkan_similarity_method_in NOT IN (''jaro'',''jarowinkler'',''qgram'') THEN		RAISE EXCEPTION USING			message = ''Invalid distance measure name '''''' || monge_elkan_similarity_method_in || '''''''',			hint = ''Valid methods are jaro, jarowinkler, and qgram'',			errcode = ''KC300''; -- Custom code for ''Bad lookup ID''.    END IF;-------------------------------------------------------------- Range/sanity checks on thresholds------------------------------------------------------------	IF handicap_factor_in < 0 OR handicap_factor_in > 1 THEN		RAISE EXCEPTION USING			message = ''handicap_factor value is out of range.'',			hint = ''Value must be in the range 0-1.'',			errcode = ''KC202''; -- Custom code for ''Numeric parameter value is too low''.    END IF;-------------------------------------------------------------- If you''ve gotten this far, everything looks good. Run it!------------------------------------------------------------    RETURN QUERY EXECUTE sql    USING base_text_in,          comparison_text_in,          base_id_in,          comparison_id_in,          handicap_factor_in,          monge_elkan_similarity_method_in;END$function$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:functions:fuzzy_match.tests.sql------------------------------------------------------------------------------------- Checks for tools.fuzzy_match (base_text_in citext, text_collection_id_in uuid, neighbors_to_check_max_in integer, monge_elkan_similarity_method_in citext, neighbor_qgram_threshold_min_in real, result_rows_max_in integer) function------------------------------------------------------------------------------------- Existence check:select * from test_case_setup('Function', 'tools', 'fuzzy_match (base_text_in citext, text_collection_id_in uuid, neighbors_to_check_max_in integer, monge_elkan_similarity_method_in citext, neighbor_qgram_threshold_min_in real, result_rows_max_in integer)', '()', 'tools.fuzzy_match base_text_in citext, text_collection_id_in uuid, neighbors_to_check_max_in integer, monge_elkan_similarity_method_in citext, neighbor_qgram_threshold_min_in real, result_rows_max_in integer existence check', 'select count(*) from pg_proc where pronamespace::regnamespace::text = ''tools''   and proname = ''fuzzy_match''   and pg_get_function_identity_arguments(oid) = ''base_text_in citext, text_collection_id_in uuid, neighbors_to_check_max_in integer, monge_elkan_similarity_method_in citext, neighbor_qgram_threshold_min_in real, result_rows_max_in integer'';', '1', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');-- Definition check:select * from test_case_setup('Function', 'tools', 'fuzzy_match (base_text_in citext, text_collection_id_in uuid, neighbors_to_check_max_in integer, monge_elkan_similarity_method_in citext, neighbor_qgram_threshold_min_in real, result_rows_max_in integer)', '()', 'tools.fuzzy_match base_text_in citext, text_collection_id_in uuid, neighbors_to_check_max_in integer, monge_elkan_similarity_method_in citext, neighbor_qgram_threshold_min_in real, result_rows_max_in integer definition check', 'select pg_get_functiondef(oid) from pg_proc where pronamespace::regnamespace::text = ''tools''   and proname = ''fuzzy_match''   and pg_get_function_identity_arguments(oid) = ''base_text_in citext, text_collection_id_in uuid, neighbors_to_check_max_in integer, monge_elkan_similarity_method_in citext, neighbor_qgram_threshold_min_in real, result_rows_max_in integer'';', 'CREATE OR REPLACE FUNCTION tools.fuzzy_match(base_text_in citext, text_collection_id_in uuid, neighbors_to_check_max_in integer DEFAULT 25, monge_elkan_similarity_method_in citext DEFAULT ''jarowinkler''::citext, neighbor_qgram_threshold_min_in real DEFAULT 0.2, result_rows_max_in integer DEFAULT 25) RETURNS TABLE(base_text citext, neighbor_text citext, neighbor_id citext, neighbor_rank integer, neighbors_count integer, highest_score decimal_score, best_method citext, avg_score decimal_score, avg_quadratic_score decimal_score, equality_check integer, jaro_score decimal_score, jaro_winkler_score decimal_score, monge_elkan_score decimal_score, monge_elkan_quadratic_score decimal_score, qgram_score decimal_score, trigram_score decimal_score) LANGUAGE plpgsql STABLEAS $function$DECLARE-------------------------------------------------------------- Setup query template, which you can RAISE NOTICE while .-- developing to see what''s in it.------------------------------------------------------------sql text := ''WITHnear_neighbors AS (  select distinct on (text <-> $1) text AS neighbor_text,         $1                             AS base_text,         source_id                      AS neighbor_id    from text_collection_item   where collection_id = $2  limit $3),measures AS (  select *,         DENSE_RANK() OVER(ORDER BY qgram(base_text, neighbor_text) DESC) AS neighbor_rank,         (base_text = neighbor_text)::int4                                AS equality_check,         monge_elkan(base_text, neighbor_text, $4)                        AS monge_elkan_score,         sqrt(monge_elkan(base_text, neighbor_text, $4))                  AS monge_elkan_quadratic_score,         jaro (base_text, neighbor_text)                                  AS jaro_score,         jarowinkler (base_text, neighbor_text)                           AS jaro_winkler_score,         qgram(base_text, neighbor_text)                                  AS qgram_score,         similarity(base_text, neighbor_text)                             AS trigram_score  from near_neighbors), handicap AS (    select base_text,           neighbor_text,           neighbor_id,           neighbor_rank::int4,           count(*) OVER() AS neighbors_count, -- Weird-looking way to get a count out of near_neighbors.           equality_check,           CASE             WHEN monge_elkan_score = 1 AND equality_check = 0 THEN 0.95             ELSE monge_elkan_score           END AS monge_elkan_score,           CASE             WHEN monge_elkan_quadratic_score = 1 AND equality_check = 0 THEN 0.95             ELSE monge_elkan_quadratic_score           END AS monge_elkan_quadratic_score,           jaro_score,           jaro_winkler_score,           qgram_score,           trigram_score      from measures     where qgram_score >= $5 ),stats AS (  select *,        (handicap.monge_elkan_score +         handicap.monge_elkan_quadratic_score +         jaro_score +         jaro_winkler_score +         qgram_score +         trigram_score) / 6 AS avg_score    from handicap), calculations AS (  select *,         sqrt(avg_score) AS avg_quadratic_score,         greatest (           monge_elkan_score,           monge_elkan_quadratic_score,           avg_score,           sqrt(avg_score),           jaro_score,           jaro_winkler_score,           qgram_score,           trigram_score) AS highest_score from stats)-- Final query, pull it all together and selsort  select base_text,         neighbor_text,         neighbor_id,         neighbor_rank::int4,         neighbors_count::int4,         highest_score::decimal_score,         (CASE highest_score            WHEN equality_check              THEN ''''equality''''            WHEN monge_elkan_quadratic_score THEN ''''monge_elkan_quadratic''''            WHEN monge_elkan_score           THEN ''''monge_elkan''''            WHEN jaro_score                  THEN ''''jaro''''            WHEN jaro_winkler_score          THEN ''''jaro_winkler''''            WHEN qgram_score                 THEN ''''qgram''''            WHEN trigram_score               THEN ''''trigram''''            WHEN avg_score                   THEN ''''avg''''            WHEN avg_quadratic_score         THEN ''''avg_quadratic''''            ELSE ''''Undefined''''         END)::citext AS best_method,         avg_score::decimal_score,         avg_quadratic_score::decimal_score,         equality_check::int4,         jaro_score::decimal_score,         jaro_winkler_score::decimal_score,         monge_elkan_score::decimal_score,         monge_elkan_quadratic_score::decimal_score,         qgram_score::decimal_score,         trigram_score::decimal_score    from calculationsorder by highest_score               DESC,         equality_check              DESC,         monge_elkan_quadratic_score DESC,         monge_elkan_score           DESC,         jaro_score                  DESC,         jaro_winkler_score          DESC,         qgram_score                 DESC,         trigram_score               DESC  limit $6'';BEGIN-------------------------------------------------------------- Existence check for the text_collection------------------------------------------------------------	IF NOT EXISTS (select 1 from text_collection where id = text_collection_id_in) THEN		RAISE EXCEPTION USING			message = ''text_collection not found with id = '''''' || text_collection_id_in || '''''''',			errcode = ''KC100''; -- Custom code for ''Bad string selector parameter value''.    END IF;-------------------------------------------------------------- Safety checks for parameters stitched into the SQL.------------------------------------------------------------	IF base_text_in = '''' THEN		RAISE EXCEPTION USING			message = ''A base string must be supplied.'',			errcode = ''KC101''; -- Custom code for ''Empty string parameter''.    END IF;    monge_elkan_similarity_method_in  := lower(monge_elkan_similarity_method_in);	IF monge_elkan_similarity_method_in NOT IN (''jaro'',''jarowinkler'',''qgram'') THEN		RAISE EXCEPTION USING			message = ''Invalid distance measure name '''''' || monge_elkan_similarity_method_in || '''''''',			hint = ''Valid methods are jaro, jarowinkler, and qgram'',			errcode = ''KC300''; -- Custom code for ''Bad lookup ID''.    END IF;-------------------------------------------------------------- Range/sanity checks on thresholds------------------------------------------------------------	IF neighbors_to_check_max_in < 1 THEN		RAISE EXCEPTION USING			message = ''neighbors_to_check_max value is too low.'',			hint = ''Value must be 1 or higher.'',			errcode = ''KC200''; -- Custom code for ''Numeric parameter value is too low''.    END IF;	IF result_rows_max_in < 1 THEN		RAISE EXCEPTION USING			message = ''result_rows_max value is too low.'',			hint = ''Value must be 1 or higher.'',			errcode = ''KC200''; -- Custom code for ''Numeric parameter value is too low''.    END IF;	IF neighbor_qgram_threshold_min_in < 0 OR neighbor_qgram_threshold_min_in > 1 THEN		RAISE EXCEPTION USING			message = ''neighbor_qgram_threshold_min value is out of range.'',			hint = ''Value must be in the range 0-1.'',			errcode = ''KC202''; -- Custom code for ''Numeric parameter value is too low''.    END IF;-------------------------------------------------------------- If you''ve gotten this far, everything looks good. Run it!------------------------------------------------------------    RETURN QUERY EXECUTE sql    USING base_text_in,          text_collection_id_in,          neighbors_to_check_max_in,          monge_elkan_similarity_method_in,          neighbor_qgram_threshold_min_in,          result_rows_max_in;END$function$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:functions:get_current_user.tests.sql------------------------------------------------------------------------------------- Checks for tools.get_current_user () function---------------------------------------------------