* day numbers are 0-6 and hours are 0-23 in postgres. this function shifts those to 1-7 and 1-24,   and gives you the hour-in-the-week result. so 12:30 am sunday night is 1, 1:00 sunday night is 2	 1:00 monday night is 25, and so on. */select ((extract(dow from dts) + 1) * 24 +	   (extract (hour from dts) + 1)) ::int2$function$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:functions:hsys_get_facility_ids.tests.sql------------------------------------------------------------------------------------- Checks for ascendco.hsys_get_facility_ids (hsys_id_in uuid) function------------------------------------------------------------------------------------- Existence check:select * from test_case_setup('Function', 'ascendco', 'hsys_get_facility_ids (hsys_id_in uuid)', '()', 'ascendco.hsys_get_facility_ids hsys_id_in uuid existence check', 'select count(*) from pg_proc where pronamespace::regnamespace::text = ''ascendco''   and proname = ''hsys_get_facility_ids''   and pg_get_function_identity_arguments(oid) = ''hsys_id_in uuid'';', '1', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');-- Definition check:select * from test_case_setup('Function', 'ascendco', 'hsys_get_facility_ids (hsys_id_in uuid)', '()', 'ascendco.hsys_get_facility_ids hsys_id_in uuid definition check', 'select pg_get_functiondef(oid) from pg_proc where pronamespace::regnamespace::text = ''ascendco''   and proname = ''hsys_get_facility_ids''   and pg_get_function_identity_arguments(oid) = ''hsys_id_in uuid'';', 'CREATE OR REPLACE FUNCTION ascendco.hsys_get_facility_ids(hsys_id_in uuid) RETURNS TABLE(facil