eal, stddev_3_above_count integer, stddev_3_above_min real, stddev_3_above_max real, stddev_3_below_count integer, stddev_3_below_min real, stddev_3_below_max real, stddev_4_above_count integer, stddev_4_above_min real, stddev_4_above_max real, stddev_4_below_count integer, stddev_4_below_min real, stddev_4_below_max real, stddev_5_above_count integer, stddev_5_above_min real, stddev_5_above_max real, stddev_5_below_count integer, stddev_5_below_min real, stddev_5_below_max real, q3_count integer, q3_min real, q3_max real, p95_count integer, p95_min real, p95_max real, p99_count integer, p99_min real, p99_max real) LANGUAGE plpgsqlAS $function$  BEGIN    RETURN QUERY EXECUTE        ''with 	overall_stats as 	(select *	   from numeric_field_stats('' || quote_literal(table_name_in) || '','' || quote_literal(field_name) || '')	 ), 	q3_stats as 	(select count(*)::int4 as q3_count,             coalesce(min('' || quote_ident(field_name) || ''),0)::float4 as q3_min,             coalesce(max('' || quote_ident(field_name) || ''),0)::float4 as q3_max		  	   from ''|| quote_ident(table_name_in) || ''	  where '' || quote_ident(field_name) || '' >= (select q3 from overall_stats)),  	stddev_stats as 	(select count(*)::int4 as stddev_count,             coalesce(min('' || quote_ident(field_name) || ''),0)::float4 as stddev_min,             coalesce(max('' || quote_ident(field_name) || ''),0)::float4 as stddev_max		  	   from ''|| quote_ident(table_name_in) || ''	  where '' || quote_ident(field_name) || '' >= (select stddev from overall_stats)),  	stddev_1_above_stats as 	(select count(*)::int4 as stddev_1_above_count,             coalesce(min('' || quote_ident(field_name) || ''),0)::float4 as stddev_1_above_min,             coalesce(max('' || quote_ident(field_name) || ''),0)::float4 as stddev_1_above_max		  	   from ''|| quote_ident(table_name_in) || ''	  where '' || quote_ident(field_name) || '' >= (select stddev_1_above from overall_stats)), 	