dent(field_name) || '' <= (select stddev_3_below from overall_stats)), 	stddev_4_above_stats as 	(select count(*)::int4 as stddev_4_above_count,             coalesce(min('' || quote_ident(field_name) || ''),0)::float4 as stddev_4_above_min,             coalesce(max('' || quote_ident(field_name) || ''),0)::float4 as stddev_4_above_max		  	   from ''|| quote_ident(table_name_in) || ''	  where '' || quote_ident(field_name) || '' >= (select stddev_4_above from overall_stats)), 	stddev_4_below_stats as 	(select count(*)::int4 as stddev_4_below_count,             coalesce(min('' || quote_ident(field_name) || ''),0)::float4 as stddev_4_below_min,             coalesce(max('' || quote_ident(field_name) || ''),0)::float4 as stddev_4_below_max		  	   from ''|| quote_ident(table_name_in) || ''	  where '' || quote_ident(field_name) || '' <= (select stddev_4_below from overall_stats)), 	stddev_5_above_stats as 	(select count(*)::int4 as stddev_5_above_count,             coalesce(min('' || quote_ident(field_name) || ''),0)::float4 as stddev_5_above_min,             coalesce(max('' || quote_ident(field_name) || ''),0)::float4 as stddev_5_above_max		  	   from ''|| quote_ident(table_name_in) || ''	  where '' || quote_ident(field_name) || '' >= (select stddev_5_above from overall_stats)), 	stddev_5_below_stats as 	(select count(*)::int4 as stddev_5_below_count,             coalesce(min('' || quote_ident(field_name) || ''),0)::float4 as stddev_5_below_min,             coalesce(max('' || quote_ident(field_name) || ''),0)::float4 as stddev_5_below_max		  	   from ''|| quote_ident(table_name_in) || ''	  where '' || quote_ident(field_name) || '' <= (select stddev_5_below from overall_stats)),	  	p95_stats as 	(select count(*)::int4 as p95_count,             coalesce(min('' || quote_ident(field_name) || ''),0)::float4 as p95_min,             coalesce(max('' || quote_ident(field_name) || ''),0)::float4 as p95_max		  	   from ''|| quote_ident(table_name_in) || ''	  where '' || quote_ident(field_name) || '' >= (select p95 from overall_stats)),	p99_stats as 	(select count(*)::int4 as p99_count,             coalesce(min('' || quote_ident(field_name) || ''),0)::float4 as p99_min,             coalesce(max('' || quote_ident(field_name) || ''),0)::float4 as p99_max		  	   from ''|| quote_ident(table_name_in) || ''	  where '' || quote_ident(field_name) || '' >= (select p99 from overall_stats))   	select overall_stats.table_name,           overall_stats.column_name,           overall_stats.min,           overall_stats.max,           overall_stats.avg,           overall_stats.variance,           overall_stats.stddev,           stddev_1_above,           stddev_1_below,           stddev_2_above,           stddev_2_below,           stddev_3_above,           stddev_3_below,           stddev_4_above,           stddev_4_below,           stddev_4_above,           stddev_5_below,                      overall_stats.q1,           overall_stats.q2,           overall_stats.q3,           overall_stats.p95,           overall_stats.iqr,           stddev_1_above_stats.stddev_1_above_count,           stddev_1_above_stats.stddev_1_above_min,           stddev_1_above_stats.stddev_1_above_max,           stddev_1_below_stats.stddev_1_below_count,           stddev_1_below_stats.stddev_1_below_min,           stddev_1_below_stats.stddev_1_below_max,           stddev_2_above_stats.stddev_2_above_count,           stddev_2_above_stats.stddev_2_above_min,           stddev_2_above_stats.stddev_2_above_max,           stddev_2_below_stats.stddev_2_below_count,           stddev_2_below_stats.stddev_2_below_min,           stddev_2_below_stats.stddev_2_below_max,           stddev_3_above_stats.stddev_3_above_count,           stddev_3_above_stats.stddev_3_above_min,           stddev_3_above_stats.stddev_3_above_max,           stddev_3_below_stats.stddev_3_below_count,           stddev_3_below_stats.stddev_3_below_min,           stddev_3_below_stats.stddev_3_below_max,           stddev_4_above_stats.stddev_4_above_count,           stddev_4_above_stats.stddev_4_above_min,           stddev_4_above_stats.stddev_4_above_max,           stddev_4_below_stats.stddev_4_below_count,           stddev_4_below_stats.stddev_4_below_min,           stddev_4_below_stats.stddev_4_below_max,           stddev_5_above_stats.stddev_5_above_count,           stddev_5_above_stats.stddev_5_above_min,           stddev_5_above_stats.stddev_5_above_max,           stddev_5_below_stats.stddev_5_below_count,           stddev_5_below_stats.stddev_5_below_min,           stddev_5_below_stats.stddev_5_below_max,                      q3_stats.q3_count,           q3_stats.q3_min,           q3_stats.q3_max,                      p95_stats.p95_count,           p95_stats.p95_min,           p95_stats.p95_max,                      p99_stats.p99_count,           p99_stats.p99_min,           p99_stats.p99_max      from overall_stats,           stddev_1_above_stats,           stddev_1_below_stats,           stddev_2_above_stats,           stddev_2_below_stats,           stddev_3_above_stats,           stddev_3_below_stats,           stddev_4_above_stats,           stddev_4_below_stats,           stddev_5_above_stats,           stddev_5_below_stats,           q3_stats,           p95_stats,           p99_stats''                                           USING table_name_in, field_name;	END;$function$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:functions:numeric_field_buckets.tests.sql------------------------------------------------------------------------------------- Checks for dba.numeric_field_buckets (table_name_in text, field_name text, bucket_count integer) function------------------------------------------------------------------------------------- Existence check:select * from test_case_setup('Function', 'dba', 'numeric_field_buckets (table_name_in text, field_name text, bucket_count integer)', '()', 'dba.numeric_field_buckets table_name_in text, field_name text, bucket_count integer existence check', 'select count(*) from pg_proc where pronamespace::regnamespace::text = ''dba''   and proname = ''numeric_field_buckets''   and pg_get_function_identity_arguments(oid) = ''table_name_in text, field_name text, bucket_count integer'';', '1', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');-- Definition check:select * from test_case_setup('Function', 'dba', 'numeric_field_buckets (table_name_in text, field_name text, bucket_count integer)', '()', 'dba.numeric_field_buckets table_name_in text, field_name text, bucket_count integer definition check', 'select pg_get_functiondef(oid) from pg_proc where pronamespace::regnamespace::text = ''dba''   and proname = ''numeric_field_buckets''   and pg_get_function_identity_arguments(oid) = ''table_name_in text, field_name text, bucket_count integer'';', 'CREATE OR REPLACE FUNCTION dba.numeric_field_buckets(table_name_in text, field_name text, bucket_count integer) RETURNS TABLE(table_name text, column_name text, bucket integer, min integer, max integer, count bigint, bar text) LANGUAGE plpgsqlAS $function$  BEGIN    RETURN QUERY EXECUTE    ''with 	range_stats as	(select min('' || quote_ident(field_name) || ''),			max('' || quote_ident(field_name) || '')			 		   from '' || quote_ident(table_name_in) || ''),			histogram as	(select  ''|| quote_literal(table_name_in) || '' as table_name,         	 ''|| quote_literal(field_name)    || '' as column_name,			  width_bucket(num_inst, range_stats.min, range_stats.max, $3 - 1) as bucket,         	  min('' || quote_ident(field_name) || ''),         	  max('' || quote_ident(field_name) || ''),			  count(*) as frequency		    from '' || quote_ident(table_name_in) || '',			 range_stats	group by bucket    	order by bucket)		 select table_name,			column_name,			bucket,			min,			max,			frequency,			repeat (''|| quote_literal('''') || '',				   (frequency::float					 / max(frequency) over() * ($3 - 1) * 2)::int			) as bar	   from histogram''	    USING table_name, field_name, bucket_count;	END;$function$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:functions:numeric_field_stats.tests.sql------------------------------------------------------------------------------------- Checks for dba.numeric_field_stats (table_name_in text, field_name text) function------------------------------------------------------------------------------------- Existence check:select * from test_case_setup('Function', 'dba', 'numeric_field_stats (table_name_in text, field_name text)', '()', 'dba.numeric_field_stats table_name_in text, field_name text existence check', 'select count(*) from pg_proc where pronamespace::regnamespace::text = ''dba''   and proname = ''numeric_field_stats''   and pg_get_function_identity_arguments(oid) = ''table_name_in text, field_name text'';', '1', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');-- Definition check:select * from test_case_setup('Function', 'dba', 'numeric_field_stats (table_name_in text, field_name text)', '()', 'dba.numeric_field_stats table_name_in text, field_name text definition check', 'select pg_get_functiondef(oid) from pg_proc where pronamespace::regnamespace::text = ''dba''   and proname = ''numeric_field_stats''   and pg_get_function_identity_arguments(oid) = ''table_name_in text, field_name text'';', 'CREATE OR REPLACE FUNCTION dba.numeric_field_stats(table_name_in text, field_name text) RETURNS TABLE(table_name text, column_name text, min integer, max integer, avg real, variance real, stddev real, stddev_1_above real, stddev_1_below real, stddev_2_above real, stddev_2_below real, stddev_3_above real, stddev_3_below real, stddev_4_above real, stddev_4_below real, stddev_5_above real, stddev_5_below real, q1 real, q2 real, q3 real, p95 real, p99 real, iqr real) LANGUAGE plpgsqlAS $function$  BEGIN    RETURN QUERY EXECUTE         ''with 	 stats as	 (select  coalesce(min( '' || quote_ident(field_name) || ''),0)::int4 as min,			  coalesce(max( '' || quote_ident(field_name) || ''),0)::int4 as max,			  coalesce(avg( '' || quote_ident(field_name) || ''),0)::float4 as avg,			  			  coalesce(variance('' || quote_ident(field_name) || ''),0)::float4 as variance,			  coalesce(stddev('' || quote_ident(field_name) || ''),0)::float4 as stddev,			  			  coalesce(percentile_cont(0.25) within group (order by '' || quote_ident(field_name) || '' asc),0)::float4 as q1,			  coalesce(percentile_cont(0.50) within group (order by '' || quote_ident(field_name) || '' asc),0)::float4 as q2,			  coalesce(percentile_cont(0.75) within group (order by '' || quote_ident(field_name) || '' asc),0)::float4 as q3,			  coalesce(percentile_cont(0.95) within group (order by '' || quote_ident(field_name) || '' asc),0)::float4 as p95,			  coalesce(percentile_cont(0.99) within group (order by '' || quote_ident(field_name) || '' asc),0)::float4 as p99	   from '' || quote_ident(table_name_in) || '')   	 select '' || quote_literal(table_name_in) || '' as table_name,         	'' || quote_literal(field_name) || '' as column_name,             min,             max,             avg,             variance,             stddev,             avg + (stddev * 1)::float4 as stddev_1_above,             avg - (stddev * 1)::float4 as stddev_1_below,             avg + (stddev * 2)::float4 as stddev_2_above,             avg - (stddev * 2)::float4 as stddev_2_below,             avg + (stddev * 3)::float4 as stddev_3_above,             avg - (stddev * 3)::float4 as stddev_3_below,             avg + (stddev * 4)::float4 as stddev_4_above,             avg - (stddev * 4)::float4 as stddev_4_below,             avg + (stddev * 5)::float4 as stddev_5_above,             avg - (stddev * 5)::float4 as stddev_5_below,                          q1,             q2,             q3,             p95,             p99, 			(q3 - q1)::float4 as iqr				from stats''	    USING table_name, field_name;	END;$function$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:functions:on_ddl_create_or_alter.tests.sql------------------------------------------------------------------------------------- Checks for event_triggers.on_ddl_create_or_alter () function------------------------------------------------------------------------------------- Existence check:select * from test_case_setup('Function', 'event_triggers', 'on_ddl_create_or_alter ()', '()', 'event_triggers.on_ddl_create_or_alter  existence check', 'select count(*) from pg_proc where pronamespace::regnamespace::text = ''event_triggers''   and proname = ''on_ddl_create_or_alter''   and pg_get_function_identity_arguments(oid) = '''';', '1', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE,