me zone) function------------------------------------------------------------------------------------- Existence check:select * from test_case_setup('Function', 'api', 'push_log_count_since (since_dts timestamp with time zone)', '()', 'api.push_log_count_since since_dts timestamp with time zone existence check', 'select count(*) from pg_proc where pronamespace::regnamespace::text = ''api''   and proname = ''push_log_count_since''   and pg_get_function_identity_arguments(oid) = ''since_dts timestamp with time zone'';', '1', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');-- Definition check:select * from test_case_setup('Function', 'api', 'push_log_count_since (since_dts timestamp with time zone)', '()', 'api.push_log_count_since since_dts timestamp with time zone definition check', 'select pg_get_functiondef(oid) from pg_proc where pronamespace::regnamespace::text = ''api''   and proname = ''push_log_count_since''   and pg_get_function_identity_arguments(oid) = ''since_dts timestamp with time zone'';', 'CREATE OR REPLACE FUNCTION api.push_log_count_since(since_dts timestamp with time zone) RETURNS TABLE(days_ago bigint, table_name citext, server_name citext, push_count bigint) LANGUAGE plpgsql STABLE SECURITY DEFINERAS $function$DECLARE-- Subtract two timestamptz values, get an interval, pull out just the days.   days_ago bigint := date_part(''day'', now()::timestamptz - since_dts)::bigint;BEGINRETURN QUERY    SELECT days_ago,           ib_table_name as table_name,           data_file_info.server_name_ as server_name,           count(*) as push_count      FROM ascendco.push_log      JOIN ascendco.data_file_info on (data_file_info.id = push_log.data_file_id)     WHERE push_log.push_dts >= since_dts  GROUP BY ib_table_name,           data_file_info.server_name_  ORDER BY ib_table_name,           data_file_info.server_name_           ;END;$function$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:functions:push_log_recent.tests.sql------------------------------------------------------------------------------------- Checks for dba.push_log_recent (table_name_in citext, limit_in integer) function------------------------------------------------------------------------------------- Existence check:select * from test_case_setup('Function', 'dba', 'push_log_recent (table_name_in citext, limit_in integer)', '()', 'dba.push_log_recent table_name_in citext, limit_in integer existence check', 'select count(*) from pg_proc where pronamespace::regnamespace::text = ''dba''   and proname = ''push_log_recent''   and pg_get_function_identity_arguments(oid) = ''table_name_in citext, limit_in integer'';', '1', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');-- Definition check:select * from test_case_setup('Function', 'dba', 'push_log_recent (table_name_in citext, limit_in integer)', '()', 'dba.push_log_recent table_name_in citext, limit_in integer definition check', 'select pg_get_functiondef(oid) from pg_proc where pronamespace::regnamespace::text = ''dba''   and proname = ''push_log_recent''   and pg_get_function_identity_arguments(oid) = ''table_name_in citext, limit_in integer'';', 'CREATE OR REPLACE FUNCTION dba.push_log_recent(table_name_in citext, limit_in integer DEFAULT 20) RETURNS TABLE(table_name citext, minutes_old integer, records_count integer, server_name citext, push_log_id citext) LANGUAGE plpgsql STABLEAS $function$BEGINRETURN QUERY   select push_log.ib_table_name,          minutes_old (push_log.push_dts) as minutes_old,          push_log.records_count,          coalesce(data_file_info.server_name_, ''Unknown server with ID '' || format_uuid(push_log.data_file_id))::citext AS server_name,          format_uuid (push_log.id)::citext AS push_log_id     from push_logleft join data_file_info on data_file_info.id = push_log.data_file_id    where ib_table_name = table_name_in  order by push_dts desc   limit limit_in;END$function$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:functions:push_log_sum_since.tests.sql------------------------------------------------------------------------------------- Checks for api.push_log_sum_since (since_dts timestamp with time zone) function------------------------------------------------------------------------------------- Existence check:select * from test_case_setup('Function', 'api', 'push_log_sum_since (since_dts timestamp with time zone)', '()', 'api.push_log_sum_since since_dts timestamp with time zone existence check', 'select count(*) from pg_proc where pronamespace::regnamespace::text = ''api''   and proname = ''push_log_sum_since''   and pg_get_function_identity_arguments(oid) = ''since_dts timestamp with time zone'';', '1', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');-- Definition check:select * from test_case_setup('Function', 'api', 'push_log_sum_since (since_dts timestamp with time zone)', '()', 'api.push_log_sum_since since_dts timestamp with time zone definition check', 'select pg_get_functiondef(oid) from pg_proc where pronamespace::regnamespace::text = ''api''   and proname = ''push_log_sum_since''   and pg_get_function_identity_arguments(oid) = ''since_dts timestamp with time zone'';', 'CREATE OR REPLACE FUNCTION api.push_log_sum_since(since_dts timestamp with time zone) RETURNS TABLE(days_ago bigint, table_name citext, server_name citext, push_sum bigint) LANGUAGE plpgsql STABLE SECURITY DEFINERAS $function$DECLARE-- Subtract two timestamptz values, get an interval, pull out just the days.   days_ago bigint := date_part(''day'', now()::timestamptz - since_dts)::bigint;BEGINRETURN QUERY    SELECT days_ago,           ib_table_name as table_name,           data_file_info.server_name_ as server_name,           sum(push_log.records_count) as push_sum      FROM ascendco.push_log      JOIN ascendco.data_file_info on (data_file_info.id = push_log.data_file_id)     WHERE push_log.push_dts >= since_dts  GROUP BY ib_table_name,           data_file_info.server_name_  ORDER BY ib_table_name,           data_file_info.server_name_           ;END;$function$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:functions:push_target_add_if_missing.tests.sql------------------------------------------------------------------------------------- Checks for ascendco.push_target_add_if_missing (schema_name_in citext, target_name_in citext, unique_path_in citext, target_type_in citext) function------------------------------------------------------------------------------------- Existence check:select * from test_case_setup('Function', 'ascendco', 'push_target_add_if_missing (schema_name_in citext, target_name_in citext, unique_path_in citext, target_type_in citext)', '()', 'ascendco.push_target_add_if_missing schema_name_in citext, target_name_in citext, uniq