INTO id_out; return id_out as id;END$function$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:functions:q_audit_step_to_v1.tests.sql------------------------------------------------------------------------------------- Checks for types_plus.q_audit_step_to_v1 (q_audit_step_in q_audit_step) function------------------------------------------------------------------------------------- Existence check:select * from test_case_setup('Function', 'types_plus', 'q_audit_step_to_v1 (q_audit_step_in q_audit_step)', '()', 'types_plus.q_audit_step_to_v1 q_audit_step_in q_audit_step existence check', 'select count(*) from pg_proc where pronamespace::regnamespace::text = ''types_plus''   and proname = ''q_audit_step_to_v1''   and pg_get_function_identity_arguments(oid) = ''q_audit_step_in q_audit_step'';', '1', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');-- Definition check:select * from test_case_setup('Function', 'types_plus', 'q_audit_step_to_v1 (q_audit_step_in q_audit_step)', '()', 'types_plus.q_audit_step_to_v1 q_audit_step_in q_audit_step definition check', 'select pg_get_functiondef(oid) from pg_proc where pronamespace::regnamespace::text = ''types_plus''   and proname = ''q_audit_step_to_v1''   and pg_get_function_identity_arguments(oid) = ''q_audit_step_in q_audit_step'';', 'CREATE OR REPLACE FUNCTION types_plus.q_audit_step_to_v1(q_audit_step_in q_audit_step) RETURNS q_audit_step_v1 LANGUAGE sqlAS $function$                   SELECT			q_audit_step_in.id,			q_audit_step_in.hsys_id,			q_audit_step_in.qsub_type_id_audit,			q_audit_step_in.step,			q_audit_step_