 WHEN relkind = ''m'' THEN ''materialized view''  WHEN relkind = ''c'' THEN ''composite type''  WHEN relkind = ''f'' THEN ''foreign table''  WHEN relkind = ''p'' THEN ''partitioned table''  WHEN relkind = ''I'' THEN ''partitioned index''  ELSE ''Unexpected relkind '' || relkindEND;$function$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:functions:rep_to_v1.tests.sql------------------------------------------------------------------------------------- Checks for types_plus.rep_to_v1 (rep_in rep) function------------------------------------------------------------------------------------- Existence check:select * from test_case_setup('Function', 'types_plus', 'rep_to_v1 (rep_in rep)', '()', 'types_plus.rep_to_v1 rep_in rep existence check', 'select count(*) from pg_proc where pronamespace::regnamespace::text = ''types_plus''   and proname = ''rep_to_v1''   and pg_get_function_identity_arguments(oid) = ''rep_in rep'';', '1', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');-- Definition check:select * from test_case_setup('Function', 'types_plus', 'rep_to_v1 (rep_in rep)', '()', 'types_plus.rep_to_v1 rep_in rep definition check', 'select pg_get_functiondef(oid) from pg_proc where pronamespace::regnamespace::text = ''types_plus''   and proname = ''rep_to_v1''   and pg_get_function_identity_arguments(oid) = ''rep_in rep'';', 'CREATE OR REPLACE FUNCTION types_plus.rep_to_v1(rep_in rep) RETURNS rep_v1 LANGUAGE sqlAS $function$                   SELECT			rep_in.id,			rep_in.user_id,			rep_in.hsys_id,			rep_in.sup_id,			rep_in.created_dts,			rep_in.updated_dts,	