ND AS temporary				  	from  pg_user u	order by u.usename;$function$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:functions:show_functions.tests.sql------------------------------------------------------------------------------------- Checks for dba.show_functions () function------------------------------------------------------------------------------------- Existence check:select * from test_case_setup('Function', 'dba', 'show_functions ()', '()', 'dba.show_functions  existence check', 'select count(*) from pg_proc where pronamespace::regnamespace::text = ''dba''   and proname = ''show_functions''   and pg_get_function_identity_arguments(oid) = '''';', '1', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');-- Definition check:select * from test_case_setup('Function', 'dba', 'show_functions ()', '()', 'dba.show_functions  definition check', 'select pg_get_functiondef(oid) from pg_proc where pronamespace::regnamespace::text = ''dba''   and proname = ''show_functions''   and pg_get_function_identity_arguments(oid) = '''';', 'CREATE OR REPLACE FUNCTION dba.show_functions() RETURNS TABLE(schema_name name, function_name name, function_type name, function_owner name, run_as text, language name, return_type name, strict text, returns_set text, comment text) LANGUAGE sql STABLEAS $function$ 	SELECT	n.nspname AS schema_name,	P.proname AS function_name,	typ.typname AS function_type,	pg_get_userbyid ( P.proowner ) AS function_owner,	CASE	WHEN P.prosecdef = TRUE THEN ''owner'' ELSE ''invoker'' END AS run_as,		l.lanname AS language,	typ.typname AS return_type,	CASE WHEN P.proisstrict = TRUE THEN ''True'' ELSE ''False'' END AS strict,	CASE WHEN P.proretset =   TRUE THEN ''True'' ELSE ''False'' END AS returns_set,	obj_description ( P.oid ) AS COMMENT FROM	pg_proc	P LEFT JOIN pg_type typ ON typ.oid = P.prorettype	LEFT JOIN pg_namespace typns ON typns.oid = typ.typnamespace	LEFT JOIN pg_namespace n ON n.oid = P.pronamespace	LEFT JOIN pg_language l ON l.oid = P.prolang	LEFT JOIN pg_user u ON P.proowner = u.usesysid	LEFT JOIN pg_database d ON d.datname = current_database () WHERE	P.prokind IN (''f'',''p'') -- Function or Procedure	AND n.nspname <> ''information_schema'' 	AND n.nspname <> ''pg_catalog'' ORDER BY	n.nspname,	P.proname ASC 	$function$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:functions:show_owners.tests.sql------------------------------------------------------------------------------------- Checks for dba.show_owners () function------------------------------------------------------------------------------------- Existence check:select * from test_case_setup('Function', 'dba', 'show_owners ()', '()', 'dba.show_owners  existence check', 'select count(*) from pg_proc where pronamespace::regnamespace::text = ''dba''   and proname = ''show_owners''   and pg_get_function_identity_arguments(oid) = '''';', '1', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');-- Definition check:select * from test_case_setup('Function', 'dba', 'show_owners ()', '()', 'dba.show_owners  definition check', 'select pg_get_functiondef(oid) from pg_proc where pronamespace::regnamespace::text = ''dba''   and proname = ''show_owners''   and pg_get_function_identity_arguments(oid) = '''';', 'CREATE OR REPLACE FUNCTION dba.show_owners() RETURNS TABLE(schema_name name, object_name name, owner_name name, object_type text) LANGUAGE sql STABLEAS $function$SELECT 	   nsp.nspname AS object_schema,       cls.relname AS object_name,        rol.rolname AS owner_name,        case cls.relkind         WHEN ''r'' THEN ''TABLE''         WHEN ''v'' THEN ''VIEW''         WHEN ''m'' THEN ''MATERIALIZED_VIEW''         WHEN ''i'' THEN ''INDEX''         WHEN ''S'' THEN ''SEQUENCE''         WHEN ''c'' THEN ''TYPE''         ELSE cls.relkind::text       END AS object_typeFROM pg_class cls  JOIN pg_roles rol ON rol.oid = cls.relowner  JOIN pg_namespace nsp ON nsp.oid = cls.relnamespaceWHERE nsp.nspname NOT IN (''information_schema'', ''pg_catalog'') AND			nsp.nspname NOT LIKE ''pg_toast%''ORDER BY  nsp.nspname, cls.relname;$function$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:functions:show_schema_rights.tests.sql------------------------------------------------------------------------------------- Checks for dba.show_schema_rights (s_name text) function------------------------------------------------------------------------------------- Existence check:select * from test_case_setup('Function', 'dba', 'show_schema_rights (s_name text)', '()', 'dba.show_schema_rights s_name text existence check', 'select count(*) from pg_proc where pronamespace::regnamespace::text = ''dba''   and proname = ''show_schema_rights''   and pg_get_function_identity_arguments(oid) = ''s_name text'';', '1', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');-- Definition check:select * from test_case_setup('Function', 'dba', 'show_schema_rights (s_name text)', '()', 'dba.show_schema_rights s_name text definition check', 'select pg_get_functiondef(oid) from pg_proc where pronamespace::regnamespace::text = ''dba''   and proname = ''show_schema_rights''   and pg_get_function_identity_arguments(oid) = ''s_name text'';', 'CREATE OR REPLACE FUNCTION dba.show_schema_rights(s_name text) RETURNS TABLE(schema_name text, user_name name, usage text, "create" text) LANGUAGE sql STABLEAS $function$  	select s_name,				 u.usename,	         CASE WHEN has_schema_privilege(u.usename, s_name, ''usage'') = TRUE then ''X'' ELSE '' '' END AS usage,         CASE WHEN has_schema_privilege(u.usename, s_name, ''create'') = TRUE then ''X'' ELSE '' '' END AS create				  	from  pg_user u	order by u.usename;$function$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:functions:show_table_rights.tests.sql------------------------------------------------------------------------------------- Checks for dba.show_table_rights (t_name text) function------------------------------------------------------------------------------------- Existence check:select * from test_case_setup('Function', 'dba', 'show_table_rights (t_name text)', '()', 'dba.show_table_rights t_name text existence check', 'select count(*) from pg_proc where pronamespace::regnamespace::text = ''dba''   and proname = ''show_table_rights''   and pg_get_function_identity_arguments(oid) = ''t_name text'';', '1', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');-- Definition check:select * from test_case_setup('Function', 'dba', 'show_table_rights (t_name text)', '()', 'dba.show_table_rights t_name text definition check', 'select pg_get_functiondef(oid) from pg_proc where pronamespace::regnamespace::text = ''dba''   and proname = ''show_table_rights''   and pg_get_function_identity_arguments(oid) = ''t_name text'';', 'CREATE OR REPLACE FUNCTION dba.show_table_rights(t_name text) RETURNS TABLE("Table_Name" name, "User_Name" name, "SELECT" text, "INSERT" text, "UPDATE" text, "DELETE" text, "TRUNCATE" text, "REFERENCES" text, "TRIGGER" text) LANGUAGE sql STABLEAS $function$	SELECT 				t.tablename,        u.usename,        CASE WHEN has_table_privilege(u.usename, concat(schemaname, ''.'', t.tablename), ''select'') = TRUE then ''X'' ELSE '' '' END AS select,        CASE WHEN has_table_privilege(u.usename, concat(schemaname, ''.'', t.tablename), ''insert'')= TRUE then ''X'' ELSE '' '' END AS insert,        CASE WHEN has_table_privilege(u.usename, concat(schemaname, ''.'', t.tablename), ''update'') = TRUE then ''X'' ELSE '' '' END AS update,        CASE WHEN has_table_privilege(u.usename, concat(schemaname, ''.'', t.tablename), ''delete'') = TRUE then ''X'' ELSE '' '' END AS delete,        CASE WHEN has_table_privilege(u.usename, concat(schemaname, ''.'', t.tablename), ''truncate'') = TRUE then ''X'' ELSE '' '' END AS truncate,        CASE WHEN has_table_privilege(u.usename, concat(schemaname, ''.'', t.tablename), ''references'') = TRUE then ''X'' ELSE '' '' END AS references,        CASE WHEN has_table_privilege(u.usename, concat(schemaname, ''.'', t.tablename), ''trigger'') = TRUE then ''X'' ELSE '' '' END AS trigger					FROM    pg_tables t,         					pg_user u                 	WHERE	  t.tablename = t_name		ORDER BY u.usename;$function$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:functions:show_view_rights.tests.sql------------------------------------------------------------------------------------- Checks for dba.show_view_rights (v_name text) function------------------------------------------------------------------------------------- Existence check:select * from test_case_setup('Function', 'dba', 'show_view_rights (v_name text)', '()', 'dba.show_view_rights v_name text existence check', 'select count(*) from pg_proc where pronamespace::regnamespace::text = ''dba''   and proname = ''show_view_rights''   and pg_get_function_identity_arguments(oid) = ''v_name text'';', '1', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');-- Definition check:select * from test_case_setup('Function', 'dba', 'show_view_rights (v_name text)', '()', 'dba.show_view_rights v_name text definition check', 'select pg_get_functiondef(oid) from pg_proc where pronamespace::regnamespace::text = ''dba''   and proname = ''show_view_rights''   and pg_get_function_identity_arguments(oid) = ''v_name text'';', 'CREATE OR REPLACE FUNCTION dba.show_view_rights(v_name text) RETURNS TABLE("View_Name" name, "User_Name" name, "SELECT" text, "INSERT" text, "UPDATE" text, "DELETE" text, "TRUNCATE" text, "REFERENCES" text, "TRIGGER" text) LANGUAGE sql STABLEAS $function$	SELECT		v.viewname,        u.usename,        CASE WHEN has_table_privilege(u.usename, concat(schemaname, ''.'', v.viewname), ''select'') = TRUE then ''X'' ELSE '' '' END AS select,        CASE WHEN has_table_privilege(u.usename, concat(schemaname, ''.'', v.viewname), ''insert'')= TRUE then ''X'' ELSE '' '' END AS insert,        CASE WHEN has_table_privilege(u.usename, concat(schemaname, ''.'', v.viewname), ''update'') = TRUE then ''X'' ELSE '' '' END AS update,        CASE WHEN has_table_privilege(u.usename, concat(schemaname, ''.'', v.viewname), ''delete'') = TRUE then ''X'' ELSE '' '' END AS delete,        CASE WHEN has_table_privilege(u.usename, concat(schemaname, ''.'', v.viewname), ''truncate'') = TRUE then ''X'' ELSE '' '' END AS truncate,        CASE WHEN has_table_privilege(u.usename, concat(schemaname, ''.'', v.viewname), ''references'') = TRUE then ''X'' ELSE '' '' END AS references,        CASE WHEN has_table_privilege(u.usename, concat(schemaname, ''.'', v.viewname), ''trigger'') = TRUE then ''X'' ELSE '' '' END AS trigger	FROM    pg_views v,			pg_user u	WHERE	  v.viewname = v_name	ORDER BY u.usename;$function$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:functions:specialty_to_v1.tests.sql------------------------------------------------------------------------------------- Checks for types_plus.specialty_to_v1 (specialty_in specialty) function------------------------------------------------------------------------------------- Existence check:select * from test_case_setup('Function', 'types_plus', 'specialty_to_v1 (specialty_in specialty)', '()', 'types_plus.specialty_to_v1 specialty_in specialty existence check', 'select count(*) from pg_proc where pronamespace::regnamespace::text = ''types_plus''   and proname = ''specialty_to_v1''   and pg_get_function_identity_arguments(oid) = ''specialty_in specialty'';', '1', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');-- Definition check:select * from test_case_setup('Function', 'types_plus', 'specialty_to_v1 (specialty_in speci