eld_name || NEW.old_value || NEW.new_value))) THEN   RETURN NULL;END IF;RETURN NEW;END$function$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:functions:trigger_function_row_compare_upsert.tests.sql------------------------------------------------------------------------------------- Checks for ascendco.trigger_function_row_compare_upsert () function------------------------------------------------------------------------------------- Existence check:select * from test_case_setup('Function', 'ascendco', 'trigger_function_row_compare_upsert ()', '()', 'ascendco.trigger_function_row_compare_upsert  existence check', 'select count(*) from pg_proc where pronamespace::regnamespace::text = ''ascendco''   and proname = ''trigger_function_row_compare_upsert''   and pg_get_function_identity_arguments(oid) = '''';', '1', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');-- Definition check:select * from test_case_setup('Function', 'ascendco', 'trigger_function_row_compare_upsert ()', '()', 'ascendco.trigger_function_row_compare_upsert  definition check', 'select pg_get_functiondef(oid) from pg_proc where pronamespace::regnamespace::text = ''ascendco''   and proname = ''trigger_function_row_compare_upsert''   and pg_get_function_identity_arguments(oid) = '''';', 'CREATE OR REPLACE FUNCTION ascendco.trigger_function_row_compare_upsert() RETURNS trigger LANGUAGE plpgsqlAS $function$BEGIN	IF  NEW.hash_1 = NULL OR	    NEW.hash_2 = NULL THEN	    RETURN NEW; -- Don''t do the comparison, hash_1 hasn''t been populated yet.	ELSE-- Do the comparison. The point of this is to avoid constantly thrashing the expression index.	   NEW.hashes_match := NEW.hash_1 = NEW.hash_2;      RETURN NEW;     -- important!   END IF;END;$function$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:functions:trigger_function_update_last_updated_dts.tests.sql------------------------------------------------------------------------------------- Checks for ascendco.trigger_function_update_last_updated_dts () function------------------------------------------------------------------------------------- Existence check:select * from test_case_setup('Function', 'ascendco', 'trigger_function_update_last_updated_dts ()', '()', 'ascendco.trigger_function_update_last_updated_dts  existence check', 'select count(*) from pg_proc where pronamespace::regnamespace::text = ''ascendco''   and proname = ''trigger_function_update_last_updated_dts''   and pg_get_function_identity_arguments(oid) = '''';', '1', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');-- Definition check:select * from test_case_setup('Function', 'ascendco', 'trigger_function_update_last_updated_dts ()', '()', 'ascendco.trigger_function_update_last_updated_dts  definition check', 'select pg_get_functiondef(oid) from pg_proc where pronamespace::regnamespace::text = ''ascendco''   and proname = ''trigger_function_update_last_updated_dts''   and pg_get_function_identity_arguments(oid) = '''';', 'CREATE OR REPLACE FUNCTION ascendco.trigger_function_update_last_updated_dts() RETURNS trigger LANGUAGE plpgsql STABLEAS $function$BEGIN  NEW.last_updated_dts = NOW(); -- Now *IS* a STABLE function, it''s safe to use in 