 =''C'' THEN ''Composite''  WHEN typcategory =''D'' THEN ''Date/time''  WHEN typcategory =''E'' THEN ''Enum''  WHEN typcategory =''G'' THEN ''Geometric''  WHEN typcategory =''I'' THEN ''Network address''  WHEN typcategory =''N'' THEN ''Numeric''  WHEN typcategory =''P'' THEN ''Pseudo-''  WHEN typcategory =''R'' THEN ''Range''  WHEN typcategory =''S'' THEN ''String''  WHEN typcategory =''T'' THEN ''Timespan''  WHEN typcategory =''U'' THEN ''User-defined''  WHEN typcategory =''V'' THEN ''Bit-string''  WHEN typcategory =''X'' THEN ''Unknown type''  ELSE ''Unexpected typcategory '' || typcategoryEND;$function$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:functions:typtype_name.tests.sql------------------------------------------------------------------------------------- Checks for tools.typtype_name (typtype text, OUT typtype_name text) function------------------------------------------------------------------------------------- Existence check:select * from test_case_setup('Function', 'tools', 'typtype_name (typtype text, OUT typtype_name text)', '()', 'tools.typtype_name typtype text, OUT typtype_name text existence check', 'select count(*) from pg_proc where pronamespace::regnamespace::text = ''tools''   and proname = ''typtype_name''   and pg_get_function_identity_arguments(oid) = ''typtype text, OUT typtype_name text'';', '1', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');-- Definition check:select * from test_case_setup('Function', 'tools', 'typtype_name (typtype text, OUT typtype_name text)', '()', 'tools.typtype_name typtype text, OUT typtype_name tex