and proname = ''view_get_column_descriptions''   and pg_get_function_identity_arguments(oid) = ''view_name_in text'';', 'CREATE OR REPLACE FUNCTION dba.view_get_column_descriptions(view_name_in text) RETURNS TABLE("Position" smallint, "Name" text, "Type" text) LANGUAGE sql STABLEAS $function$SELECT attnum                  AS "Position",       attname::text           AS "Name",       atttypid::regtype::text AS "Type"FROM   pg_attributeWHERE  attrelid = view_name_in::regclass AND    -- ::regclass is a magic casting and a Very Good Thing. You can       attnum > 0 AND       NOT attisdroppedORDER  BY attnum$function$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:functions:view_get_referenced_tables.tests.sql------------------------------------------------------------------------------------- Checks for dba.view_get_referenced_tables (view_name_in text) function------------------------------------------------------------------------------------- Existence check:select * from test_case_setup('Function', 'dba', 'view_get_referenced_tables (view_name_in text)', '()', 'dba.view_get_referenced_tables view_name_in text existence check', 'select count(*) from pg_proc where pronamespace::regnamespace::text = ''dba''   and proname = ''view_get_referenced_tables''   and pg_get_function_identity_arguments(oid) = ''view_name_in text'';', '1', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');-- Definition check:select * from test_case_setup('Function', 'dba', 'view_get_referenced_tables (view_name_in text)', '()', 'dba.view_get_referenced_tables view_name_in text definition check', 'select pg_get_functiondef(oid) from pg_proc where pronamespace::regnamespace::text = ''dba''   and proname = ''view_get_referenced_tables''   and pg_get_function_identity_arguments(oid) = ''view_name_in text'';', 'CREATE OR REPLACE FUNCTION dba.view_get_referenced_tables(view_name_in text) RETURNS TABLE(referenced_table text) LANGUAGE sql STABLEAS $function$  SELECT u.table_schema || ''.'' || u.table_name as referenced_table    FROM information_schema.view_table_usage u    JOIN information_schema.views v         ON  u.view_schema = v.table_schema         AND u.view_name = v.table_name   WHERE u.view_name = view_name_in::regclass::nameORDER BY u.view_schema,         u.view_name;$function$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:functions:views_using_field.tests.sql------------------------------------------------------------------------------------- Checks for dba.views_using_field (table_name text, column_name text) function------------------------------------------------------------------------------------- Existence check:select * from test_case_setup('Function', 'dba', 'views_using_field (table_name text, column_name text)', '()', 'dba.views_using_field table_name text, column_name text existence check', 'select count(*) from pg_proc where pronamespace::regnamespace::text = ''dba''   and proname = ''views_using_field''   and pg_get_function_identity_arguments(oid) = ''table_name text, column_name text'';', '1', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');-- Definition check:select * from test_case_setup('Function', 'dba', 'views_using_field (table_name text, column_name text)', '()', 'dba.views_using_field table_name text, column_name text definition check', 'select pg_get_functiondef(oid) from pg_proc where pronamespace::regnamespace::text = ''dba''   and proname = ''views_using_field''   and pg_get_function_identity_arguments(oid) = ''table_name text, column_name text'';', 'CREATE OR REPLACE FUNCTION dba.views_using_field(table_name text, column_name text) RETURNS TABLE(schema_name citext, view_name citext) LANGUAGE sqlAS $function$SELECT pg_namespace.nspname::citext   AS schema_name,       pg_class.oid::regclass::citext AS view_name FROM pg_attribute   -- columns for the table JOIN pg_depend   -- objects that depend on the column   ON pg_depend.refobjsubid = pg_attribute.attnum  AND pg_depend.refobjid = pg_attribute.attrelid JOIN pg_rewrite  -- rules depending on the column   ON pg_rewrite.oid = pg_depend.objid JOIN pg_class    -- views for the rules   ON pg_class.oid = pg_rewrite.ev_class JOIN pg_namespace -- I added this is to include the schema_name in the output. -- DPA   ON pg_class.relnamespace  = pg_namespace.oidWHERE pg_class.relkind = ''v''    -- only interested in views  -- dependency must be a rule depending on a relation  AND pg_depend.classid     = ''pg_rewrite''::regclass  AND pg_depend.refclassid  = ''pg_class''::regclass  AND pg_depend.deptype     = ''n''    -- normal dependency  AND pg_attribute.attrelid = table_name::regclass  AND pg_attribute.attname  = column_name;$function$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:functions:web_user_to_v1.tests.sql------------------------------------------------------------------------------------- Checks for types_plus.web_user_to_v1 (web_user_in web_user) function---