'select count(*) from pg_proc where pronamespace::regnamespace::text = ''tools''   and proname = ''word_type''   and pg_get_function_identity_arguments(oid) = ''word_in citext'';', '1', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');-- Definition check:select * from test_case_setup('Function', 'tools', 'word_type (word_in citext)', '()', 'tools.word_type word_in citext definition check', 'select pg_get_functiondef(oid) from pg_proc where pronamespace::regnamespace::text = ''tools''   and proname = ''word_type''   and pg_get_function_identity_arguments(oid) = ''word_in citext'';', 'CREATE OR REPLACE FUNCTION tools.word_type(word_in citext) RETURNS citext LANGUAGE sqlAS $function$select description::citext  from ts_debug(''simple'', word_in)  limit 1 -- only the first word$function$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:functions:work_get_source_name.tests.sql------------------------------------------------------------------------------------- Checks for ascendco.work_get_source_name (activity_in citext) function------------------------------------------------------------------------------------- Existence check:select * from test_case_setup('Function', 'ascendco', 'work_get_source_name (activity_in citext)', '()', 'ascendco.work_get_source_name activity_in citext existence check', 'select count(*) from pg_proc where pronamespace::regnamespace::text = ''ascendco''   and proname = ''work_get_source_name''   and pg_get_function_identity_arguments(oid) = ''activity_in citext'';', '1', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');-- Definition check:select * from test_case_setup('Function', 'ascendco', 'work_get_source_name (activity_in citext)', '()', 'ascendco.work_get_source_name activity_in citext definition check', 'select pg_get_functiondef(oid) from pg_proc where pronamespace::regnamespace::text = ''ascendco''   and proname = ''work_get_source_name''   and pg_get_function_identity_arguments(oid) = ''activity_in citext'';', 'CREATE OR REPLACE FUNCTION ascendco.work_get_source_name(activity_in citext) RETURNS citext LANGUAGE sql IMMUTABLEAS $function$SELECTCASE WHEN activity_in =          ''Activity''         THEN  ''Activity''::citext	 WHEN activity_in =          ''Assembly''         THEN  ''Assembly''::citext	 WHEN activity_in =          ''Collection Inv''   THEN  ''CollectionInv''::citext	 WHEN activity_in =          ''Sterilize Inv''    THEN  ''SterilizerLoad_Inv''::citext -- Catch this first, pattern below would catch it .	 WHEN left(activity_in,9) =  ''Sterilize''        THEN  ''SterilizerLoad''::citext	 WHEN activity_in =          ''Case Cart''        THEN  ''Scan''::citext	 WHEN activity_in =          ''Decon Receiving''  THEN  ''Scan''::citext	 WHEN activity_in =          ''Decon Sink''       THEN  ''Scan''::citext	 WHEN activity_in =          ''Deliver Inv''      THEN  ''Scan''::citext	 ELSE                                                 (''Unknown '' || activity_in)::citextEND as source_name_out;$function$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:indexes:activity_pkey.tests.sql------------------------------------------------------------------------------------- Checks for ascendc