dentity_arguments(oid) = '''';', 'CREATE OR REPLACE PROCEDURE ascendco.system_delete_marked_and_log_sp() LANGUAGE plpgsqlAS $procedure$BEGIN-- Execute configured auto-deletes and save results in a CTE.with deletion_results as (    SELECT *      FROM system_delete_marked()    )-- Take the results from the CTE where something actually got deleted and push them into deletion_log.INSERT INTO deletion_log (                  schema_name,                  table_name,                  operation_name,                  deleted_count)         SELECT  schema,                 table_name,                 ''DELETE'',                 count            FROM deletion_results           WHERE count > 0;-- ANALYZE modified tables.-- Note: We''re in a stored procedure, there is no result returned. Use PERFORM on this function instead of SELECT.PERFORM system_analyze_after_deletions();END;$procedure$', '', 'text', '{"comparator":"equals","column_order":"ignore","case_sensitivity":"blind","whitespace_cleaning":"all","normalize_line_endings":true}', 'Pass', '{user_change_structure}', FALSE, FALSE, '', '');--Coyote:Users:dpadams2:Resilio Sync:DPA:nautilus:generated_tests:procedures:view_register.tests.sql------------------------------------------------------------------------------------- Checks for dba.view_register (schema_name_in citext, view_name_in citext, description_in citext, domo_dataset_in citext) procedure------------------------------------------------------------------------------------- Existence check:select * from test_case_setup('Procedure', 'dba', 'view_register (schema_name_in citext, view_name_in citext, description_in citext, domo_dataset_in citext)', '', 'dba.view_register schema_name_in citext, view_name_in citext, description_in citext, domo_dataset_in citext existence check', 'select count(*) from pg_proc where pronamespace::regnamespace::text = ''dba''   and proname = ''view_register''   and pg_get_function_identity_argu